function UserList() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchUsers() {
      try {
        setLoading(true);
        const response = await fetch('https://api.example.com/users');
        
        if (!response.ok) {
          throw new Error('Error en la respuesta del servidor');
        }
        
        const data = await response.json();
        setUsers(data);
        setError(null);
      } catch (err) {
        setError(err.message);
        setUsers([]);
      } finally {
        setLoading(false);
      }
    }

    fetchUsers();
  }, []); // Array vacío significa que se ejecuta solo al montar

  if (loading) return <div>Cargando...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <ul>
      {users.map(user => (
        <li key={user.id}>{user.name}</li>
      ))}
    </ul>
  );
}`})})})]}),jsxRuntimeExports.jsxs("div",{children:[jsxRuntimeExports.jsx("h3",{className:"text-xl font-semibold text-slate-800 dark:text-white mb-2",children:"Librería Axios"}),jsxRuntimeExports.jsx("p",{className:"text-slate-600 dark:text-slate-300",children:"Axios es una biblioteca popular para realizar solicitudes HTTP en JavaScript. Ofrece una API más fácil de usar que fetch, soporte automático para JSON, transformación de solicitudes y respuestas, cancelación de solicitudes, y mejor manejo de errores."}),jsxRuntimeExports.jsx("div",{className:"bg-slate-100 dark:bg-slate-700 rounded-lg p-4 mt-3 overflow-x-auto",children:jsxRuntimeExports.jsx("pre",{className:"text-slate-800 dark:text-slate-200 text-sm",children:jsxRuntimeExports.jsx("code",{children:`// Usando Axios
